import "./card.scss";

const Card = () => {
  return (
    <div className="card">
      <div className="image">
        <img src={video} />
      </div>
      <div className="stats">
        <span className="numbers"> + 50000</span>
        <span className="text"> فيديو في جميع المواد </span>
      </div>
    </div>
  );
};

export default Card;
